import React from "react";
import { useQuery } from "react-query";

export default function TooLazyComponent() {
  const query = useQuery({
    queryKey: "getHugeData",
    queryFn: () =>
      fetch("http://localhost:1000/getHugeData").then((res) => res.json()),
    suspense: true,
  });

  return (
    <div>
      <h2>I'm Too Lazy {JSON.stringify(query.data)}!</h2>
      <img
        src="data:image/png;base64,"
        width="250px"
      />
    </div>
  );
}
